import React from 'react';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
import AboutUs from './pages/AboutUs';
import Clients from './pages/Clients';
import Home from './pages/Home';
import Companies from './pages/Companies';
import OurBusiness from './pages/OurBusiness';
import Contact from './pages/Contact';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Router exact path="/" component={Home} />
        <Router exact path="/clients" component={Clients} />
        <Router exact path="/companies" component={Companies} />
        <Router exact path="/about-us" component={AboutUs} />
        <Router exact path="/our-business" component={OurBusiness} />
        <Router exact path="/contact" component={Contact} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
